export default function works(state=[],action){
    switch(action.type){
        case "WORKS_CONTENT_DATA_SUCCESS":
            action.payload.map((data)=>{
                return[...state,action.payload]
            })
            console.log(state)
            return action.payload;
        default:
            return state
    }
}
